Let's continue with the Shape example from the previous section. Imagine that we want to add a Square class that extends the Rectangle class. class Square(Rectangle): def __init__(self, side): super().__init__(side, side) def set_width(self, width): self.width = self.length = width def set_length(self, length): self.length = self.width = length # Usage
def process_shape(r: Rectangle): r.set_width(10) return r.area() square = Square(5)
print("Expected area of 5x10 square:", process_shape(square)) # Incorrectly returns 100 This is bad because changing the width of a Square changes its length too, which is unexpected for a Rectangle. It breaks the LSP as Square cannot be substituted for Rectangle without altering the program's behavior.

